import * as React from 'react';
import Box from '@mui/material/Box';
import { Stack, Typography } from '@mui/material';

const PredictTest: React.FC = () => {


    return (
        <div className='predicttest'>
            <Box height={'40%'} sx={{mb:1}}>
                <Stack
                    direction="column"
                    justifyContent="center"
                    alignItems="center"
                    spacing={2}
                    sx={{mt:5}}
                >
                    <Typography>합격 예측 기업 : 확률%</Typography>
                    <Box>키워드 단어들</Box>
                </Stack>
            </Box>
            <Box sx={{ bgcolor: 'white', mx:'auto', alignContent: 'center' }}>
                <Stack
                    direction="column"
                    justifyContent="center"
                    alignItems="center"
                    spacing={2}
                    sx={{
                        paddingBottom:20
                    }}
                >
                    <Typography sx={{mt:5}}>자소서1</Typography>
                    <Box sx={{ display: 'flex', width: '80%', height: 400, mx:'auto', my:'auto', border: '1px solid', borderColor: 'grey.500', borderRadius: 2, mb:1 }} >
                        <Typography sx={{mt:5}}>윤석열 대통령의 ‘한-미 핵전력 공동기획·공동연습’ 발언이 파장을 일으키고 있다. 조 바이든 미국 대통령이 언론의 관련 질문에 짧게 “아니다”라고 답변하며 양국 간 정상 발언을 두고 혼선이 빚어졌다. 양국 군당국이 지난해 말 합의했던 사항의 연장선에서 나온 발언이라곤 하나, 상대국과 조율되지 않은 예민한 사안을 대통령이 개별 언론사에 먼저 불쑥 밝힌 것은 매우 경솔하고 부적절하다.
                        윤 대통령은 지난 2일 보도된 인터뷰에서 “한·미가 미국의 핵전력을 ‘공동기획-공동연습’ 개념으로 운용하는 방안을 논의하고 있다”며 “핵무기는 미국의 것이지만 정보 공유와 계획, 훈련을 한·미가 공동으로 해야 한다. 미국도 상당히 긍정적인 입장”이라고 말했다. 양국 군당국은 지난해 11월 제54차 한-미 안보협의회의(SCM)에서 확장억제 협력 방안으로 “정보 공유, 협의 절차, 공동 기획 및 실행 등을 더욱 강화해나가기로” 한 바 있다. 구체적인 내용은 협의 중인 단계다. 이런 상황에서 대통령이 마치 거의 확정된 것처럼 먼저 얘기한 것으로 보인다.
                        용어도 정확하지 못했다. 한-미 안보협의회의 공동성명에는 ‘공동실행’(Joint Execution)으로 돼 있으나 윤 대통령은 ‘공동연습’(Joint Exercise)이라고 말해 마치 한국이 핵을 가지고 미국과 공동으로 연습을 하는 것으로 오해하게 했다. 실제 외신 기자는 바이든 대통령에게 한국과 ‘공동 핵 연습’(Joint Nuclear Exercises)을 논의 중이냐고 질문했다. 백악관은 이와 관련해 “(바이든) 대통령이 말했듯 우리는 공동 핵 연습을 논의하고 있지 않다”며 “한국은 핵 비보유국이기 때문”이라고 설명했다. 바이든 대통령이 핵보유국이 함께하는 연습으로 생각해 “아니다”라고 말했다는 설명으로 해석된다. 고도로 복잡한 이슈를 윤 대통령이 신중하지 못하게 발언해 혼선을 일으킨 셈이 됐다.
                        미국이 ‘핵 비확산체제’라는 대외정책의 근간을 바꿀 가능성이 거의 없는 상황에서 ‘핵 공동기획-공동연습’이란 표현도 과장된 측면이 있다. 실제 ‘핵 공유’를 하는 북대서양조약기구(나토)의 유럽 동맹국들도 작전 통제와 사후 평가 등 일부 과정에 제한적으로 참여할 뿐이다. 자칫 북한뿐 아니라 일본·대만 등 다른 나라를 자극할 수 있는 위험성도 있다. 북한의 고도화하는 핵능력에 대한 실효적인 대응 방안을 정교하게 마련해야 하는 지금, 대통령의 발언이 되레 혼란과 불안을 부추기는 일이 있어선 안 될 것이다.
                        </Typography>
                    </Box>
                </Stack>
            </Box>
        </div>
    );
}
export default PredictTest;
